import React, { Fragment } from "react";
import {Doughnut, Bar} from 'react-chartjs-2'
import 'chart.js/auto';

const serviceData = {
  labels: ['Space', 'Air', 'Drone'],
  datasets: [{
    data: [12, 5, 6]
  }]
}

const usageData = {
  labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'],
  datasets: [{
    data: [120, 307, 49, 214, 194, 145, 323, 312, 256, 245, 211, 112]
  }]
}


const BarChart = () => {
  return (
    <div>
   <Bar data={usageData}/>
 </div>
  )
}

const DoughnutChart = () => {
  return (
    <div>
      <Doughnut data={serviceData}/>
    </div>
  )
}

export {
  BarChart,
  DoughnutChart
}
